  }

  get dorsal() {
    return this._dorsal;
  }

  get nombre() {
    return this._nombre;
  }

  get equipo() {
    return this._equipo;
  }

  get partidosJugados() {
    return this._partidosJugados;
  }

  get minutosJugados() {
    return this._minutosJugados;
  }

  get golesEncajados() {
    return this._golesEncajados;
  }

  get goles() {
    return this._goles;
  }

  get asistencias() {
    return this._asistencias;
  }

  get tarjetasAmarillas() {
    return this._tarjetasAmarillas;
  }

  get tarjetasRojas() {
    return this._tarjetasRojas;
  }

}
